import React from "react";

export default function TashuView({add, pk}) {
    return (
        <div className="tashu-view">
            <div>
                <h2>타슈 정보</h2>
                <p>주소: {add}</p>
                <p>키: {pk}</p>
            </div>
        </div>
    )
}
